import { StyleSheet } from "react-native";


const styles = StyleSheet.create({
    container: {
        position: 'absolute',
        top: 50,
        zIndex: 100,
        marggroundColor: 'red'
    },
    logo: {
        width: '100',
        height: '20',
    },
    menu: {
        width: '25',
        height: '25',

    }

});

export default styles;
